%[text] # Functions
%[text] 
%%
function RP = getFemurLength(contentT,options)

arguments
    contentT table
    options.rowIdx {mustBeNumeric} = 0; % for alignment purposes
    options.segName {mustBeTextScalar} = "right femur"
end

VN = ["LastName","SegName","Length","Volume","Extent","Diameter"];
num = height(contentT);

RP = table(strings(num,1), ...
    strings(num,1), ...
    zeros(num,1), ...
    zeros(num, 1), ...
    zeros(num,3), ...
    zeros(num, 1), ...
    VariableNames=VN);

if options.rowIdx % align all femurs to indicated femur
        [mv,st] = getMVst(contentT(options.rowIdx,:)); % load medical volume and seg table
        SEG1 = mmGetMedicalVolumeSegment(mv,st, segName=options.segName); % select indicated femur
        SEG1.fv = mmGetSurface(SEG1.mask,"affTrfm",SEG1.tform.A); % create surface in mm space without plotting (saves time)
        SEG1 = alignFemur2Axis(SEG1);
        fprintf('aligning all segments to %s segment',contentT.LastName(options.rowIdx))
end

figure;
tiledlayout("flow", "TileSpacing","tight","Padding","tight"); % create a tiled layout for plotting
hwb = waitbar(0,'Calculating...');
warning('off', 'medical:medicalVolume:noEndian')

for n=1:num

    [mv,st,lastName] = getMVst(contentT(n,:)); % load medical volume and seg table
    
    try % let's see if this works
        seg = mmGetMedicalVolumeSegment(mv,st, segName=options.segName); % select indicated femur
        seg.fv = mmGetSurface(seg.mask,"affTrfm",seg.tform.A); % create surface in mm space without plotting (saves time)
        seg = alignFemur2Axis(seg);

        if options.rowIdx
            seg.fv.vertices = mmAlignSurfaces(SEG1.fv.vertices, seg.fv.vertices); % align current seg1 to SEG1
        end

        seg = getFemurDiameter(seg);

        seg.extent = range(seg.fv.vertices); % value in mm
        seg.length = max(seg.extent); % value in mm

        rp = table(string(lastName), ...
            seg.segName, ...
            seg.length, ... mm
            seg.volume * prod(0.1 * seg.spacing), ... cm3
            seg.extent, ... mm
            seg.diameter,... mm
            VariableNames=VN); 
        RP(n,:)  = rp; % concatenate region props table

        nexttile
        la = lower(st.SegName) == options.segName;
        mmPlotSurface(seg.fv,st.Color(la,:),0.5);
        mmSetSurfacePlotProps;
        axis off

        % drawcuboid('Position',[min(seg.fv) range(seg.fv)],'FaceAlpha',0.1)
        title(lastName)

    catch ME % nope didn't work
        fprintf('%d. %s. %s\n',n,lastName, ME.message)
        disp(st)
        continue
    end

    waitbar(n/num,hwb,lastName)

end
RP(RP.Volume==0,:) = []; % move empty rows
delete(hwb)
warning('on')
end


function [mv,st,lastName] = getMVst(ct)
% loads medical volume and segmentation table based on ct
% INPUT: ct - one row from contentT

filepath = fullfile(ct.folder,ct.name); % construct file path
lastName = extractBefore(ct.name,("_"|" "));
mv = medicalVolume(filepath); % load segmentation volume
st = mmGetSlicerSegTable(filepath);  % get slicer segmentation
end

function seg = alignFemur2Axis(seg)
seg.fv.vertices = seg.fv.vertices - mean(seg.fv.vertices); % center to 0,0,0
seg.fv.vertices = mmAlignSurface2Axes(seg.fv.vertices); % align to xy plane
seg.fv.vertices = mmRotateSurfaceVertices(seg.fv.vertices,'y',90);  % rotate back to align with zplane
end

function seg = getFemurDiameter(seg)
% Finds centroid of femur and spans from the 

rp = regionprops3(seg.mask,"Volume","Centroid"); % center of femur - should be in shaft
[~,maxIdx] = max(rp.Volume); % if any noise, use largest volume
cntrz = round(rp.Centroid(maxIdx,3)); % centroid of largest volume
span = 50; % span from centroid
seg.shaft = seg.mask(:,:,cntrz-span:cntrz+span); % crop femur down to shaft

seg.edt = bwdist(~seg.shaft); % Euclidean Distance Transform of cropped volume
seg.skel = bwskel(seg.shaft,MinBranchLength=20); % skeletonize
seg.Radii = seg.edt(seg.skel) * seg.spacing(1) ; % get radii and convert to mm
seg.diameter = median(seg.Radii)*2; % double

end



